import AddForm from './AddForm'
import TodoList from './TodoList'

function TodoPage({setInputText, inputText, todos, setTodos, setStatus, filteredTodos}){
    return (
        <div>
        < AddForm
        setInputText = {setInputText}
        inputText = {inputText}
        todos = {todos}
        setTodos = {setTodos}
        setStatus = {setStatus}
        />
        < TodoList
        todos = {todos}
        setTodos = {setTodos}
        filteredTodos = {FilteredTodos}
        />
        </div>
    )
}

export default TodoPage;
